    false,nt"url": null,nt"notes": "These data depict Essential Fish Habitat
    (EFH) conservation areas off Washington, Oregon, and California. The coordinate
    locations are from NMFS' Final Rule to implement Amendment 19 to the Pacific Coast
    Groundfish Fishery Management Plan (71 FR 27408; May 11, 2006). In order to minimize
    to the extent practicable adverse effects from fishing, the final rule prohibits
    fishing with various gear types within these areas. Consult the text of the final
    rule for specific details about each area and the management measures. The prohibitions
    are listed in Section 660.306 and the official coordinates are listed in Sections
    660.397, 660.398, and 660.399 of the final rule.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
